from sympy import isprime, primerange
def ok(p): # p assumed prime
  return not any(isprime((1<<k)^p) for k in range(p.bit_length()))
def aupto(limit):
  alst = []
  for p in primerange(2, limit+1):
    if ok(p): alst.append(p)
  return alst
